// PanelAdmin.js
import React, { useEffect, useState } from 'react';
import { obtenerUsuarios, eliminarUsuario } from '../logica/logicaPanelAdmin';

const PanelAdmin = () => {
  const [usuarios, setUsuarios] = useState([]);

  useEffect(() => {
    setUsuarios(obtenerUsuarios());
  }, []);

  return (
    <div>
      <h2>Panel de Administrador</h2>
      <ul>
        {usuarios.map(u => (
          <li key={u.id}>
            {u.usuario} <button onClick={() => eliminarUsuario(u.id)}>Eliminar</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default PanelAdmin;
